# Retrieve our input and output directory paths
inputDir = Configuration.path('segmentation_data_sliced')
outputDir = Configuration.path('classification_data')

# Iterate over each morphotype and copy the relevant files
for morphotype, images in MAPPINGS.items():
	
	# Ensure the subdirectory for the morphotype exists and is empty
	subdir = os.path.join(outputDir, morphotype)
	if os.path.exists(subdir) == True:
		shutil.rmtree(subdir)
	os.makedirs(subdir)
	
	# Progress output
	print('Copying {} images for morphotype {}...'.format(len(images), morphotype))
	sys.stdout.flush()
	
	# Copy each of the image files for the morphotype, stripping out the alpha channel
	# (Note: removing the alpha channel here isn't strictly necessary since the classification network will ignore it anyway,
	#  but doing so results in a better visual result when we generate the HTML report for the classification network.)
	for image in images:
		channels = cv2.imread(os.path.join(inputDir, image), flags=cv2.IMREAD_COLOR)
		cv2.imwrite(os.path.join(subdir, image), channels)

# Progress output
print('Done.')
